import { useLoaderData } from "react-router-dom";

export const Home = () => {
  const products = useLoaderData();

  return (
    <div>
      {products.map((product) => (
        <div key={product.id}>
          <h2>{product.name}</h2>
          <p>{product.description}</p>
        </div>
      ))}
    </div>
  );
};
